import React from 'react';
import AnimatedCursor from 'react-animated-cursor';

const CustomCursor = () => { 
	return (
		<AnimatedCursor 
			innerSize={8}
			outerSize={8}
			color='22, 22, 22'
			outerAlpha={1}
			innerScale={0.7}
			outerScale={5}
			zIndex={1000}
		/>
	)
}

export default CustomCursor;
